ADOBE PHOTOSHOP CS5 TRAINING MANUAL FOR WINDOWS &amp; MAC

Adobe Photoshop CS5 for Photographers: The Ultimate Workshop

If you already have a good knowledge of Adobe Photoshop and are looking to advance your skills, Adobe Photoshop CS5 for Photographers: The Ultimate Workshop is the book youve been waiting for. Renowned photographers Martin Evening and Jeff Schewe impart their Photoshop tips and workflow, showing you how to use a vast array of rarely seen advanced Photoshop techniques. Whether the subject is serious retouching work, weird and wonderful compositions, or planning a shoot before you ve even picked up a camera, you can be sure that the advice is based on years of practical experience.

Full of inspirational photographs and hundreds of full-colour screenshots to show you how it s done, this book features:

Advice on becoming a retouching master with advanced masking and compositing techniques -A detailed workflow for preparing your images for the best possible output, showing you how to meet both deadline and budge without sacrificing quality -26 movie tutorials on the included DVD, offering over 3 hours of movie content

The ideal companion to Photoshop CS5 for Photographers, this is a must-have resource for any serious user of Adobe Photoshop.

